<!DOCTYPE html>
<html lang="ko">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
<title>틀린그림찾기</title>
<link href="https://fonts.googleapis.com/css2?family=Jua&display=swap" rel="stylesheet">
<style>
*{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent}
:root{--pk:#ffd6e4;--pk2:#ffebf1;--pk3:#fff3f7;--pk4:#ffaec9;--acc:#ff6b9d;--dark:#3d2b35;--ok:#6dd4a0;--fail:#ff7b7b;--w:#fff}
html,body{font-family:'Jua',sans-serif;background:var(--pk3);min-height:100vh;min-height:100dvh;overflow:hidden;color:var(--dark);touch-action:manipulation}

.hearts{position:fixed;inset:0;pointer-events:none;z-index:0;overflow:hidden}
.hearts i{position:absolute;bottom:-20px;font-style:normal;opacity:.1;animation:rise linear infinite}
@keyframes rise{0%{transform:translateY(0) rotate(0);opacity:0}10%{opacity:.1}90%{opacity:.1}100%{transform:translateY(-110vh) rotate(360deg);opacity:0}}

.scr{display:none;position:relative;z-index:1;height:100vh;height:100dvh;flex-direction:column;align-items:center;justify-content:center}
.scr.on{display:flex}

/* TITLE */
#title{gap:24px}
.logo-img{width:220px;height:220px;object-fit:cover;border-radius:18px;border:3px solid var(--pk);box-shadow:0 8px 30px rgba(255,107,157,.2);animation:float 4s ease-in-out infinite}
@keyframes float{0%,100%{transform:translateY(0)}50%{transform:translateY(-8px)}}
.play-btn{
  padding:16px 48px;border:none;border-radius:40px;
  background:linear-gradient(135deg,var(--pk4),var(--acc));
  color:#fff;font-family:'Jua',sans-serif;font-size:1.15em;
  cursor:pointer;box-shadow:0 4px 18px rgba(255,107,157,.3);
  transition:all .25s;letter-spacing:1px;
}
.play-btn:hover,.play-btn:active{transform:translateY(-3px) scale(1.03);box-shadow:0 6px 24px rgba(255,107,157,.4)}

/* GAME */
#game{padding:8px;gap:6px}
.hud{
  display:flex;align-items:center;justify-content:space-between;
  width:100%;max-width:500px;
  padding:8px 16px;background:var(--w);border-radius:14px;
  box-shadow:0 2px 10px rgba(255,107,157,.1);font-size:.95em;flex-shrink:0;
}
.timer{color:var(--acc);display:flex;align-items:center;gap:4px}
.timer.warn{color:var(--fail);animation:pulse .5s ease infinite}
@keyframes pulse{0%,100%{transform:scale(1)}50%{transform:scale(1.08)}}
.dots{display:flex;gap:5px}
.dot{width:12px;height:12px;border-radius:50%;border:2px solid var(--pk);background:var(--pk2);transition:all .35s cubic-bezier(.34,1.56,.64,1)}
.dot.ok{background:var(--ok);border-color:var(--ok);transform:scale(1.25)}
.found-txt .cur{color:var(--acc);font-size:1.15em}

.panels{
  display:flex;flex-direction:column;gap:8px;
  align-items:center;width:100%;
  flex:1;min-height:0;
  overflow-y:auto;-webkit-overflow-scrolling:touch;
  padding:4px 0 12px;
}
.panel{
  position:relative;border-radius:14px;overflow:hidden;
  border:3px solid var(--pk);background:var(--w);
  box-shadow:0 3px 14px rgba(255,107,157,.12);
  cursor:crosshair;width:100%;max-width:500px;flex-shrink:0;
}
.panel img{display:block;width:100%;height:auto;pointer-events:none;user-select:none;-webkit-user-drag:none}
.panel .tag{
  position:absolute;top:8px;left:50%;transform:translateX(-50%);
  background:rgba(255,255,255,.85);backdrop-filter:blur(6px);
  padding:3px 14px;border-radius:20px;font-size:.75em;color:var(--acc);
  pointer-events:none;z-index:4;
}

.mark{
  position:absolute;width:40px;height:40px;border-radius:50%;
  border:3px solid;pointer-events:none;z-index:5;
  transform:translate(-50%,-50%) scale(0);
}
.mark.ok{border-color:var(--ok);background:rgba(109,212,160,.25);animation:pop .5s cubic-bezier(.34,1.56,.64,1) forwards}
.mark.no{border-color:var(--fail);background:rgba(255,123,123,.2);animation:shake .45s ease forwards}
@keyframes pop{0%{transform:translate(-50%,-50%) scale(0)}60%{transform:translate(-50%,-50%) scale(1.3)}100%{transform:translate(-50%,-50%) scale(1)}}
@keyframes shake{0%{transform:translate(-50%,-50%) scale(0)}20%{transform:translate(calc(-50% - 4px),-50%) scale(1)}40%{transform:translate(calc(-50% + 4px),-50%) scale(1)}60%{transform:translate(calc(-50% - 2px),-50%) scale(1)}80%{transform:translate(calc(-50% + 2px),-50%) scale(1)}100%{transform:translate(-50%,-50%) scale(.7);opacity:0}}

.circ{
  position:absolute;border-radius:50%;border:2.5px dashed var(--ok);
  pointer-events:none;z-index:3;
  transform:translate(-50%,-50%) scale(0);
  animation:cin .4s cubic-bezier(.34,1.56,.64,1) forwards;
}
@keyframes cin{to{transform:translate(-50%,-50%) scale(1)}}

/* RESULT */
#result{gap:18px;text-align:center}
.res-emoji{font-size:3.5em;animation:bounceIn .7s cubic-bezier(.34,1.56,.64,1)}
@keyframes bounceIn{0%{transform:scale(0) rotate(-15deg)}60%{transform:scale(1.15) rotate(4deg)}100%{transform:scale(1) rotate(0)}}
.res-title{font-size:1.8em;color:var(--acc)}
.res-msg{font-size:.9em;font-weight:400;color:var(--dark);max-width:320px;line-height:1.6}
.stats{display:flex;gap:16px}
.stat{background:var(--w);border-radius:14px;padding:14px 22px;box-shadow:0 2px 10px rgba(255,107,157,.1);text-align:center}
.stat b{display:block;font-size:1.6em;color:var(--acc)}
.stat small{font-size:.75em;color:var(--pk4)}
.btns{display:flex;gap:10px;margin-top:4px}
.btn1{padding:13px 32px;border:none;border-radius:40px;background:linear-gradient(135deg,var(--pk4),var(--acc));color:#fff;font-family:'Jua',sans-serif;font-size:1em;cursor:pointer;box-shadow:0 4px 14px rgba(255,107,157,.3);transition:all .25s}
.btn1:hover,.btn1:active{transform:translateY(-2px);box-shadow:0 6px 20px rgba(255,107,157,.4)}

/* GIFT POPUP */
.popup-overlay{position:fixed;inset:0;background:rgba(61,43,53,.5);backdrop-filter:blur(4px);z-index:200;display:flex;align-items:center;justify-content:center;opacity:0;pointer-events:none;transition:opacity .3s}
.popup-overlay.on{opacity:1;pointer-events:auto}
.popup{background:var(--w);border-radius:20px;padding:28px 24px;max-width:320px;width:90%;text-align:center;box-shadow:0 12px 40px rgba(255,107,157,.25);transform:scale(.8) translateY(20px);transition:transform .35s cubic-bezier(.34,1.56,.64,1);display:flex;flex-direction:column;align-items:center;gap:14px}
.popup-overlay.on .popup{transform:scale(1) translateY(0)}
.popup-icon{font-size:2.8em}
.popup-title{font-size:1.3em;color:var(--acc)}
.popup-desc{font-size:.85em;color:var(--dark);line-height:1.5}
.code-box{display:flex;align-items:center;gap:8px;background:var(--pk2);border:2px solid var(--pk);border-radius:12px;padding:10px 14px;width:100%}
.code-box code{flex:1;font-family:'Jua',sans-serif;font-size:1em;color:var(--acc);word-break:break-all;text-align:left}
.copy-btn{padding:8px 16px;border:none;border-radius:10px;background:linear-gradient(135deg,var(--pk4),var(--acc));color:#fff;font-family:'Jua',sans-serif;font-size:.85em;cursor:pointer;transition:all .2s;white-space:nowrap}
.copy-btn:active{transform:scale(.95)}
.copy-btn.copied{background:var(--ok)}
.popup-close{margin-top:2px;padding:10px 28px;border:2px solid var(--pk);border-radius:30px;background:var(--w);color:var(--acc);font-family:'Jua',sans-serif;font-size:.95em;cursor:pointer;transition:all .2s}
.popup-close:hover{border-color:var(--acc)}

.confetti{position:fixed;inset:0;pointer-events:none;z-index:99}
.conf{position:absolute;top:-16px;animation:fall linear forwards}
@keyframes fall{0%{transform:translateY(0) rotate(0);opacity:1}100%{transform:translateY(105vh) rotate(720deg);opacity:0}}

@media(min-width:700px){
  .panels{flex-direction:row;justify-content:center;overflow:visible}
  .panel{max-width:400px}
}
</style>
</head>

(()=>{const c=document.getElementById('bgh');for(let i=0;i<15;i++){const h=document.createElement('i');h.textContent='♥';h.style.left=Math.random()*100+'%';h.style.animationDuration=(10+Math.random()*15)+'s';h.style.animationDelay=Math.random()*12+'s';h.style.fontSize=(14+Math.random()*20)+'px';c.appendChild(h)}})();

// Difference locations in % of image dimensions
// Compared the two images:
// 1) Pink lips on gorilla face ~48%, 42%
// 2) Blue laser beam from eyes ~38%, 43%  
// 3) Red sticker/tag on chest ~54%, 47%
// 4) Gold star decorations on belly ~43%, 73%
const DIFFS=[
  {x:48, y:42, r:6},   // pink lips
  {x:35, y:43, r:10},  // laser beam
  {x:55, y:47, r:6},   // red sticker
  {x:43, y:73, r:9},   // star decorations
];
const TOTAL=DIFFS.length;
const HIT_R=9;

let found=[],tLeft=134,tInt=null,active=false;

function show(id){document.querySelectorAll('.scr').forEach(s=>s.classList.remove('on'));document.getElementById(id).classList.add('on')}

function go(){
  tLeft=134;found=[];active=true;
  DIFFS.forEach(d=>d.found=false);
  const dots=document.getElementById('dots');dots.innerHTML='';
  for(let i=0;i<TOTAL;i++){const e=document.createElement('div');e.className='dot';e.id='d'+i;dots.appendChild(e)}
  document.getElementById('fN').textContent='0';
  document.getElementById('tN').textContent=TOTAL;
  document.querySelectorAll('.mark,.circ').forEach(m=>m.remove());
  setupPanel('pM');
  setupPanel('pO');
  show('game');
  startTimer();
}

function setupPanel(pid){
  const old=document.getElementById(pid);
  const np=old.cloneNode(true);
  old.parentNode.replaceChild(np,old);
  const handler=(cx,cy)=>{
    if(!active)return;
    const img=np.querySelector('img');
    const rect=img.getBoundingClientRect();
    const px=(cx-rect.left)/rect.width*100;
    const py=(cy-rect.top)/rect.height*100;
    check(px,py,np);
  };
  np.addEventListener('click',e=>{e.preventDefault();handler(e.clientX,e.clientY)});
  np.addEventListener('touchend',e=>{e.preventDefault();const t=e.changedTouches[0];handler(t.clientX,t.clientY)},{passive:false});
}

function check(px,py,panel){
  let hit=false;
  for(let i=0;i<DIFFS.length;i++){
    const d=DIFFS[i];if(d.found)continue;
    if(Math.hypot(d.x-px,d.y-py)<HIT_R){
      d.found=true;found.push(i);hit=true;
      document.getElementById('d'+i).classList.add('ok');
      document.getElementById('fN').textContent=found.length;
      ['pO','pM'].forEach(pid=>{const p=document.getElementById(pid);addMark(p,d.x,d.y,'ok');addCircle(p,d.x,d.y,d.r*2)});
      if(found.length===TOTAL)setTimeout(()=>end(true),400);
      break;
    }
  }
  if(!hit)addMark(panel,px,py,'no');
}

function addMark(p,px,py,cls){const m=document.createElement('div');m.className='mark '+cls;m.style.left=px+'%';m.style.top=py+'%';p.appendChild(m);if(cls==='no')setTimeout(()=>m.remove(),500)}
function addCircle(p,px,py,sz){const c=document.createElement('div');c.className='circ';c.style.left=px+'%';c.style.top=py+'%';c.style.width=sz+'%';c.style.height='0';c.style.paddingBottom=sz+'%';p.appendChild(c)}

function startTimer(){if(tInt)clearInterval(tInt);updTimer();tInt=setInterval(()=>{tLeft--;updTimer();if(tLeft<=0)end(false)},1000)}
function updTimer(){const m=Math.floor(tLeft/60),s=tLeft%60;const el=document.getElementById('tmr');el.textContent=`⏱ ${m}:${String(s).padStart(2,'0')}`;el.classList.toggle('warn',tLeft<=30)}

function end(won){
  active=false;clearInterval(tInt);
  const el=134-tLeft,m=Math.floor(el/60),s=el%60;
  document.getElementById('sF').textContent=`${found.length}/${TOTAL}`;
  document.getElementById('sT').textContent=`${m}:${String(s).padStart(2,'0')}`;
  if(won){
    document.getElementById('rE').textContent='🐒';
    document.getElementById('rT').textContent='성공!';
    document.getElementById('rM').textContent='자기야 왜 또 칭얼거려';
    confetti();
    setTimeout(()=>showGift(),1200);
  }else{
    document.getElementById('rE').textContent='⏰';
    document.getElementById('rT').textContent='시간 초과!';
    document.getElementById('rM').textContent=`${found.length}개 찾았어요! 다시 도전? 💪`;
  }
  setTimeout(()=>show('result'),won?200:400);
}

function confetti(){
  const c=document.getElementById('cfc');c.innerHTML='';
  const cols=['#ff6b9d','#ffa3bf','#ff85ab','#ffc2d4','#6dd4a0','#ffcc70','#70b8ff'];
  for(let i=0;i<60;i++){const p=document.createElement('div');p.className='conf';p.style.left=Math.random()*100+'%';p.style.backgroundColor=cols[Math.floor(Math.random()*cols.length)];p.style.animationDuration=(1.2+Math.random()*1.8)+'s';p.style.animationDelay=Math.random()*.4+'s';const sz=6+Math.random()*7;p.style.width=sz+'px';p.style.height=sz+'px';p.style.borderRadius=Math.random()>.5?'50%':'2px';c.appendChild(p)}
  setTimeout(()=>c.innerHTML='',3500);
}

function showGift(){document.getElementById('giftPopup').classList.add('on')}
function closePopup(){document.getElementById('giftPopup').classList.remove('on')}
function copyCode(){
  const code=document.getElementById('giftCode').textContent;
  navigator.clipboard.writeText(code).then(()=>{
    const btn=document.getElementById('copyBtn');
    btn.textContent='복사됨!';btn.classList.add('copied');
    setTimeout(()=>{btn.textContent='복사';btn.classList.remove('copied')},2000);
  }).catch(()=>{
    // fallback
    const ta=document.createElement('textarea');ta.value=code;document.body.appendChild(ta);ta.select();document.execCommand('copy');document.body.removeChild(ta);
    const btn=document.getElementById('copyBtn');btn.textContent='복사됨!';btn.classList.add('copied');
    setTimeout(()=>{btn.textContent='복사';btn.classList.remove('copied')},2000);
  });
}
</script>
</body>
</html>
